import React from 'react';
import { Box, Typography, Paper } from '@mui/material';

export default function AIAssistant() {
  return (
    <Box>
      <Typography variant="h4" component="h1" gutterBottom>
        AI Assistant
      </Typography>
      <Paper sx={{ p: 2 }}>
        <Typography>
          AI Assistant interface will be implemented here.
        </Typography>
      </Paper>
    </Box>
  );
}
